import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import logo from './logo.png';
import About from './About';
import Home from './Home';
import Articles from './Articles';
import Animators from './Animators'

function App() {
  return (
    <Router>
  <nav>
    <Link to="/"><img src={logo} width="80px" alt='logo'/></Link>
    <Link to="/about">О нас</Link>
    <Link to="/articles">Статьи</Link>
    <Link to="/animators">Аниматоры</Link>
    <Link to="/show">Шоу-программы и квесты</Link>
    <Link to="/masterClasses">Мастер-классы</Link>
    <Link to="/additional">Дополнительные услуги</Link>
  </nav>

  <Routes>
       <Route path="/" element={<Home/>}/>
       <Route path="/about" element={<About/>}/>
       <Route path="/articles" element={<Articles/>}/>
       <Route path="/animators" element={<Animators/>}/>
  </Routes>
  </Router>
  );
}

export default App;
